export function GeoLocation() {

    function success(position) {
        console.log('Sucesso garai')
        console.log(position);
    }
    
    function error() {
        console.log('Falhou garai')
    }
    
    const watchLocation = navigator.geolocation.watchPosition(success, error);
}
